/* create UI opbejcts require for 2FA macro */

const xapi = require('xapi');

let DEBUG = true;

export function createPanel() {
  // DEBUG && console.log("creating UI elements ");
  let panel = `

  <Extensions>
    <Version>1.10</Version>
    <Panel>
      <Order>1</Order>
      <PanelId>Lock</PanelId>
      <Origin>local</Origin>
      <Location>HomeScreen</Location>
      <Icon>Custom</Icon>
      <Name>Lock</Name>
      <ActivityType>Custom</ActivityType>
      <CustomIcon>
        <Content></Content>
        <Id>e5e70d8c008743e06ec118ae7c14e965db05333446765ff6665e60a8be5fc2e6</Id>
      </CustomIcon>
    </Panel>
      </Extensions>`;
    xapi.Command.UserInterface.Extensions.Panel.Save(
            { PanelId: 'Lock' },
            panel
          );

panel = `
<Extensions>
    <Version>1.10</Version>
    <Panel>
      <Order>2</Order>
      <PanelId>duoAuthSelect</PanelId>
      <Origin>local</Origin>
      <Location>Hidden</Location>
      <Icon>Lightbulb</Icon>
      <Name>Panel</Name>
      <ActivityType>Custom</ActivityType>
      <Page>
        <Name>Webex Device Two Factor Authentication</Name>
        <Row>
          <Name>Authentication Device</Name>
          <Widget>
            <WidgetId>widget_2</WidgetId>
            <Name>Text</Name>
            <Type>Text</Type>
            <Options>size=2;fontSize=small;align=center</Options>
          </Widget>
          <Widget>
            <WidgetId>duoDevice</WidgetId>
            <Type>Spinner</Type>
            <Options>size=2;style=vertical</Options>
          </Widget>
          <Widget>
            <WidgetId>executeAuthentication</WidgetId>
            <Name>Authenticate</Name>
            <Type>Button</Type>
            <Options>size=2</Options>
          </Widget>
        </Row>
        <Options/>
      </Page>
    </Panel>
  </Extensions>`;

xapi.Command.UserInterface.Extensions.Panel.Save(
        { PanelId: 'duoAuthSelect' },
        panel
      );
DEBUG && console.log("init, UI");
}
